DIY Dream Team Nursery Reveal!When we had the first DIY Dream Team makeover last January, we never dreamed we’d be back doing a nursery for their rainbow baby ❤️. It’s been the most beautiful and fun journey making over now the second space for this incredible and deserving couple with my two besties by my side.  Getting to do WHAT I love WITH people I love FOR people I love is the best feeling on earth.  Thank you Nicole and Chris for not only being the worlds best hosts, but allowing us in your home to create a space where the three of you will create memories for a lifetime.  I am honored and I hope you guys (and sweet baby Hunter!) enjoy every ounce of it ❤️
